function load(a,v){for(var e=$(".main"),i=_.template(game_div_template),t=0;t<a.length;t++){var d=a[t];d.CoverImg=v+d.CoverImg;var l=i(d);e.append(l)}var s=a.length;$(".menu").html(s)}var game_div_template='<div class="game">  <div class="title"><%= Title %></div>  <div class="coverimg"><img src="<%= CoverImg %>"/></div>  <div class="metadata">    <div class="installed"><%= Installed %></div>    <div class="status"><%= Status %></div>  </div></div>';